import React from 'react';
import MovieInfo from './MovieInfo'; // Підключаємо компонент MovieInfo

const App = () => {
  // Припустимо, що у вас є масив об'єктів фільмів, де кожен об'єкт містить title та imageUrl
  const movies = [
    {
      title: "Avatar",
      imageUrl: "http://ia.media-imdb.com/images/M/MV5BMTYwOTEwNjAzMl5BMl5BanBnXkFtZTcwODc5MTUwMw@@._V1_SX300.jpg",
    },
    {
      title: "I Am Legend",
      imageUrl: "http://ia.media-imdb.com/images/M/MV5BMTU4NzMyNDk1OV5BMl5BanBnXkFtZTcwOTEwMzU1MQ@@._V1_SX300.jpg",
    },
  ];

  return (
    <div className="app">
      {movies.map((movie, index) => (
        <MovieInfo key={index} title={movie.title} imageUrl={movie.imageUrl} />
      ))}
    </div>
  );
}

export default App;
